import { Component } from 'react';
import axios from 'axios';

export default class ApiConnect extends Component {



    render() {

        axios.post('https://jsonplaceholder.typicode.com/posts')
        .then(
            res => {
                console.log(res.data);
                this.setState({
                    datos: res.data.posts,
                    status: 'success'
                });
            });

        return (

        <ul>
                             </ul>

                )
        ;
    }

}
